export default function Iletisim() {

    return (
        <div style={{textAlign:"center"}}>
            <h2 style={{paddingTop:'30px'}}>İletişim Sayfası İçeriği</h2>
            <p style={{padding:'75px', textAlign:'left'}}>
            Metin aralarına utandırıcı sözcükler gizlenmediğinden emin olmanız gerekir. Eğer bir Lorem Ipsum pasajı kullanacaksanız.
            </p>
        </div>
    )

}
